--
-- Create procedure `sp_GetTransactionInfo`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE sp_GetTransactionInfo ()
BEGIN
  SELECT
    t.TrasactionId,
    t.InvoiceNo,
    t.CustId,
    t.SoldToName,
    t.SoldToAddress,
    t.SoldToState,
    t.SalesmId,
    s.SalesmanName,
    t.FactoryId,
    f.FactoryName,
    t.CommissionRulesId,
    t.SoldToName,
    t.ShipToAddress,
    t.SoldToCity,
    t.SoldToState,
    t.TotalSalesAmt,
    t.GrossCommRate,
    t.GrossCommAmt,
    t.SalesmanCommAmt,
    t.CreatedDate,
    t.CreatedBy,
    t.UpdatedDate,
    t.UpdatedBy,
    t.IsActive,
    t.FinYear
  FROM salestrasaction t
    LEFT JOIN customer c
      ON t.CustId = c.CustId
    LEFT JOIN salesman s
      ON t.SalesmId = s.SalesmId
    LEFT JOIN factory f
      ON t.CustId = f.FactoryId
    LEFT JOIN commissionrules r
      ON t.CommissionRulesId = r.CommissionRulesId

  ORDER BY t.TrasactionId;
END
$$

--
-- Create procedure `sp_GetCommRules`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE sp_GetCommRules (IN id int)
BEGIN
  IF (id = 0) THEN

    SELECT
      r.CommissionRulesId,
      r.CustId,
      c.CustomerName,
      r.FactoryCategoryId,
      r.FactoryId,
      f.FactoryName,
      f.PrincCode,
      r.CommisionRate,
      r.CreatedDate,
      r.CreatedBy,
      r.UpdatedDate,
      r.UpdatedBy,
      r.IsActiveForAll,
      r.IsActive,
      r.FinYearId
    FROM commissionrules r
      LEFT JOIN customer c
        ON r.CustId = c.CustId
      LEFT JOIN factory f
        ON r.FactoryId = f.FactoryId


    ORDER BY r.CommissionRulesId, r.CreatedDate;

  ELSE
    SELECT
      r.CommissionRulesId,
      r.CustId,
      c.CustomerName,
      r.FactoryCategoryId,
      r.FactoryId,
      f.FactoryName,
      f.PrincCode,
      r.CommisionRate,
      r.CreatedDate,
      r.CreatedBy,
      r.UpdatedDate,
      r.UpdatedBy,
      r.IsActiveForAll,
      r.IsActive,
      r.FinYearId
    FROM commissionrules r
      LEFT JOIN customer c
        ON r.CustId = c.CustId
      LEFT JOIN factory f
        ON r.FactoryId = f.FactoryId

    WHERE r.CommissionRulesId = id
    ORDER BY r.CommissionRulesId, r.CreatedDate;

  END IF;


END
$$

